# A generic alembic.ini file.
# For a real setup, this would be generated by `alembic init migrations`

[alembic]
# path to migration scripts
script_location = migrations

# template for new migration scripts
# file_template = %%(rev)s_%%(slug)s

# timezone for timestamps within migrations
# timezone = UTC

# sys.path path, will be prepended to sys.path if present.
# defaults to the current working directory.
# prepend_sys_path = .

# Logging configuration
[loggers]
keys = root,sqlalchemy,alembic

[handlers]
keys = console

[formatters]
keys = generic

[logger_root]
level = WARN
handlers = console
qualname =

[logger_sqlalchemy]
level = WARN
handlers =
qualname = sqlalchemy.engine

[logger_alembic]
level = INFO
handlers =
qualname = alembic

[handler_console]
class = StreamHandler
args = (sys.stderr,)
level = NOTSET
formatter = generic

[formatter_generic]
format = %(levelname)-5.5s [%(name)s] %(message)s
datefmt = %H:%M:%S

# Particular configuration for the ARTEX Agent
# We will use environment variables for the database URL.
# The actual URL will be read in migrations/env.py
sqlalchemy.url = DB_URL_FROM_ENV_VAR_IN_ENV_PY
# Example if you were to use a direct variable (less flexible):
# sqlalchemy.url = mysql+aiomysql://user:pass@host/db

# Other Alembic settings can be configured here
# e.g., version_locations, hook_scripts, etc.
# For async, ensure your env.py is set up correctly.
# post_write_hooks =

